description:
Team Chicken Shirt originally released a commercial for ING Direct&amp;#039;s super saver competition, but then they thought - why stop there? With the general response being &quot;We love those characters&quot;, Team Chicken Shirt is now doing 1 minute - spin-off shorts. 

This is more of a featurette on the making of the commercial...what happened may not be what you expect...

Enjoy!

